import FabricBoard from "../FabricBoard/FabricBoard";

const BOARD_TYPE = {
  FABRIC: "FABRIC",
  KONVA: "KONVA",
  PAPERJS: "PAPERJS",
};

export default function Main() {
  const [boardType, setBoardType] = useState();
  return <div>{boardType === FABRIC && <FabricBoard />}</div>;
}
